script: |
  super -f text -I q11168.spq | sort > q11168.out

inputs:
  - name: q11168.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) cor0 WHERE + + col1 + - CAST ( NULL AS INTEGER ) BETWEEN ( - + col2 ) AND NULL OR NOT col2 = - col0 / col1;
  - name: tab1

outputs:
  - name: q11168.out
    data: |
      51	14	96
      85	5	59
      91	47	68
